import React from 'react';
import Navbar from './Navbar';
//import './Signup.css'

 function Signup(){
    return (
        <>
            <Navbar />
            <div className='background'>
                <form className='signupForm'>
                    <p className='title'>Signup</p>
                    <input type='text' placeholder='Email Address' className='email'></input>
                    <input type='text' placeholder='Password' className='pass'></input>
                    <select className='sex'>
                        <option value="Male">Male</option>
                        <option value="Female">Female</option>
                    </select>
                    <input type="number" placeholder='Age in Years' className='Age'></input>
                    <button className='submit'>Login</button>
                </form>
            </div>
        </>
    )
}

export default Signup;
